.Router {
  position: absolute;
  width: 100%;
  height: 100%;
  transition: all 0.377s ease;
  box-sizing: border-box;
  overflow-y: auto;
}

.slide-left-enter,
.slide-right-leave-active {
  opacity: 0;
  -webkit-transform: translate(-100%, 0);
  transform: translate(-100%, 0);
}

.slide-left-leave-active,
.slide-right-enter {
  opacity: 0;
  -webkit-transform: translate(100%, 0);
  transform: translate(100% 0);
}

.isOn {
  width: 0.55rem;
  height: 0.55rem;
  position: absolute;
  z-index: 200;
  top: 1.4rem;
  right: 0.3rem;
  background: url("./assets/icons/playOn.png") 0 0 no-repeat;
  background-size: 100%;
}
.isOff {
  width: 0.55rem;
  height: 0.55rem;
  position: absolute;
  z-index: 2000;
  top: 1.4rem;
  right: 0.3rem;
  background: url("./assets/icons/playOff.png") 0 0 no-repeat;
  background-size: 100%;
}
